insert into Sammelbucheintrag (timestamp, location, text, bild, fk_user_id) values ('2022-11-18T07:42:16', 'Funkhaus Wien', 'Das Funkhaus Wien war ein beeindruckendes Gebäude mit einer faszinierenden Geschichte. Es war interessant, die verschiedenen Studios und Aufnahmeräume zu sehen und mehr über die Arbeit hinter den Kulissen zu erfahren.', null, 1);
insert into Sammelbucheintrag (timestamp, location, text, bild, fk_user_id) values ('2023-04-05T18:29:01', 'Cafe Sacher', 'Das Cafe Sacher war ein gemütlicher Ort für einen Kaffee und ein Stück Sachertorte. Die Atmosphäre war angenehm und das Personal war freundlich und zuvorkommend.', 'data:image/jpeg;base64,', 1);
insert into Sammelbucheintrag (timestamp, location, text, bild, fk_user_id) values ('2023-01-22T14:55:38', 'Burgtheater', 'Das Burgtheater war ein fantastischer Ort für eine Aufführung. Die Architektur und die Innenausstattung waren atemberaubend und die Vorstellung war unglaublich unterhaltsam.', null, 1);
insert into Sammelbucheintrag (timestamp, location, text, bild, fk_user_id) values ('2022-09-03T03:10:49', 'Zentralfriedhof', 'Der Zentralfriedhof war an einem trüben Herbsttag etwas düster und unheimlich, aber dennoch faszinierend. Es war interessant, die verschiedenen Gräber und Gedenkstätten zu sehen und über die Persönlichkeiten hinter ihnen zu erfahren.', 'data:image/jpeg;base64,', 1);
insert into Sammelbucheintrag (timestamp, location, text, bild, fk_user_id) values ('2023-06-28T09:17:22', 'Cafe Sacher', 'Das Cafe Sacher war ein Genuss für die Sinne. Die Innenausstattung und Atmosphäre waren klassisch und elegant, und der Kaffee und die Sachertorte waren ausgezeichnet. Das Personal war freundlich und aufmerksam.', null, 2);
